// HasHost applies the HasEdge predicate on the "host" edge.
func HasHost() predicate.HostdeviceResource {
	return predicate.HostdeviceResource(func(s *sql.Selector) {
		step := sqlgraph.NewStep(
			sqlgraph.From(Table, FieldID),
			sqlgraph.Edge(sqlgraph.O2O, false, HostTable, HostColumn),
		)
		sqlgraph.HasNeighbors(s, step)
	})
}

// HasHostWith applies the HasEdge predicate on the "host" edge with a given conditions (other predicates).
func HasHostWith(preds ...predicate.HostResource) predicate.HostdeviceResource {
	return predicate.HostdeviceResource(func(s *sql.Selector) {
		step := newHostStep()
		sqlgraph.HasNeighborsWith(s, step, func(s *sql.Selector) {
			for _, p := range preds {
				p(s)
			}
		})
	})
}

// And groups predicates with the AND operator between them.
func And(predicates ...predicate.HostdeviceResource) predicate.HostdeviceResource {
	return predicate.HostdeviceResource(sql.AndPredicates(predicates...))
}

// Or groups predicates with the OR operator between them.
func Or(predicates ...predicate.HostdeviceResource) predicate.HostdeviceResource {
	return predicate.HostdeviceResource(sql.OrPredicates(predicates...))
}

// Not applies the not operator on the given predicate.
func Not(p predicate.HostdeviceResource) predicate.HostdeviceResource {
	return predicate.HostdeviceResource(sql.NotPredicates(p))
}
